import React, { useState } from 'react';
import Header from './components/Header';
import ProfileHeader from './components/ProfileHeader';
import Sidebar from './components/Sidebar';
import MainSection from './components/MainSection';
import MenteeProfilePage from './components/MenteeProfilePage';

const mentee1 = {
  name: 'Ariana Grande',
  pronouns: 'she/her/hers',
  location: 'California',
  profileImg: process.env.PUBLIC_URL + '/weekend-headshot.jpg',
  role: 'Product Design Associate',
  department: 'Product Design',
  education: 'UCLA',
  about: 'Ariana is passionate about design and user experience. She loves collaborating with teams to create beautiful and functional products.',
  skills: ['Figma', 'UX/UI', 'Collaboration'],
  interests: ['Music', 'Art', 'Travel'],
  work: [
    {
      title: 'Product Design Associate',
      company: 'TechFlow Solutions',
      duration: '2022 - Present',
      bullets: [
        'Designed user interfaces for mobile and web apps',
        'Worked closely with engineers and product managers',
        'Conducted user research and usability testing',
      ],
    },
  ],
};

const mentee2 = {
  name: 'Alex Hamilton',
  pronouns: 'he/him/his',
  location: 'New York',
  profileImg: process.env.PUBLIC_URL + '/weekend-headshot.jpg',
  role: 'Product Marketing Intern',
  department: 'Marketing',
  education: 'NYU',
  about: 'Alex is a marketing enthusiast with a keen interest in digital campaigns and analytics.',
  skills: ['Digital Marketing', 'Data Analysis'],
  interests: ['Reading', 'Sports', 'Technology'],
  work: [
    {
      title: 'Product Marketing Intern',
      company: 'FICO',
      duration: '2023 - Present',
      bullets: [
        'Assisted in campaign planning and execution',
        'Analyzed marketing data and created reports',
        'Supported the team in various marketing initiatives',
      ],
    },
  ],
};

function App() {
  const [currentView, setCurrentView] = useState('mentor'); // 'mentor', 'ariana', 'alex'

  const renderContent = () => {
    switch (currentView) {
      case 'ariana':
        return <MenteeProfilePage mentee={mentee1} />;
      case 'alex':
        return <MenteeProfilePage mentee={mentee2} />;
      default:
        return (
          <div className="container">
            <ProfileHeader />
            <div className="main-content">
              <Sidebar />
              <MainSection />
            </div>
          </div>
        );
    }
  };

  return (
    <div className="App">
      <Header />
      {/* Navigation buttons */}
      <div style={{ padding: '10px 20px', background: '#f8f9fa', borderBottom: '1px solid #dee2e6' }}>
        <button
          onClick={() => setCurrentView('mentor')}
          style={{ 
            marginRight: 10, 
            padding: '8px 16px', 
            background: currentView === 'mentor' ? '#4a90e2' : '#fff', 
            color: currentView === 'mentor' ? '#fff' : '#333',
            border: '1px solid #4a90e2',
            borderRadius: 4,
            cursor: 'pointer'
          }}
        >
          Mentor Profile
        </button>
        <button
          onClick={() => setCurrentView('ariana')}
          style={{ 
            marginRight: 10, 
            padding: '8px 16px', 
            background: currentView === 'ariana' ? '#4a90e2' : '#fff', 
            color: currentView === 'ariana' ? '#fff' : '#333',
            border: '1px solid #4a90e2',
            borderRadius: 4,
            cursor: 'pointer'
          }}
        >
          Ariana's Profile
        </button>
        <button
          onClick={() => setCurrentView('alex')}
          style={{ 
            padding: '8px 16px', 
            background: currentView === 'alex' ? '#4a90e2' : '#fff', 
            color: currentView === 'alex' ? '#fff' : '#333',
            border: '1px solid #4a90e2',
            borderRadius: 4,
            cursor: 'pointer'
          }}
        >
          Alex's Profile
        </button>
      </div>
      {renderContent()}
    </div>
  );
}

export default App;
